import React from "react";
import "./App.css";

//==========importaciones======================================

import Contador from "./Components/Contador";

//=================================================
type Title = {
  title: String;
};

function App({ title }: Title): JSX.Element {
  return (
    <>
      <div className="App">
        <h1 className="title">Workshop-{title} </h1>

        <Contador />
      </div>
    </>
  );
}

export default App;
